            <div className="container">
                <Card title="Cadastro de usuÃ¡rio">
                    <div className="row">
                        <div className="col-lg-12">
                            <div className="bs-component">
                                <FormGroup htmlFor="inputNome" label="Nome: *">
                                    <input type="text"
                                        value={this.state.nome}
                                        onChange={e => this.setState({nome: e.target.value})}
                                        className="form-control"
                                        id="inputNome"
                                        name="nome"
                                        placeholder="Digite o Nome" />
                                </FormGroup>
                                <FormGroup htmlFor="inputEmail" label="Email: *">
                                    <input type="email"
                                        value={this.state.email}
                                        onChange={e => this.setState({email: e.target.value})}
                                        className="form-control"
                                        id="inputEmail"
                                        placeholder="Digite o Email" />
                                </FormGroup>
                                <FormGroup htmlFor="inputSenha" label="Senha: *">
                                    <input type="password"
                                        value={this.state.senha}
                                        onChange={e => this.setState({senha: e.target.value})}
                                        className="form-control"
                                        id="inputSenha"
                                        placeholder="Password" />
                                </FormGroup>
                                <FormGroup htmlFor="inputSenhaRepeticao" label="Repita a senha: *">
                                    <input type="password"
                                        value={this.state.senhaRepeticao}
                                        onChange={e => this.setState({senhaRepeticao: e.target.value})}
                                        className="form-control"
                                        id="inputSenhaRepeticao"
                                        placeholder="Password" />
                                </FormGroup>
                                <button type="button" className="btn btn-success">Salvar</button>
                                <button type="button" className="btn btn-danger">Voltar</button>
                            </div>
                        </div>
                    </div>
                </Card>
            </div>
        );
    }
}

export default CadastroUsuario;
